// src/App.js
import React from 'react';
import './App.css'; // Tu CSS global
import Navbar from './components/Navbar';
import Inicio from './components/Inicio';
import SobreNosotros from './components/SobreNosotros'; // Asegúrate de que estos componentes existan
import Productos from './components/Productos';
import Ubicacion from './components/Ubicacion';
import RealizarPedido from './components/RealizarPedido';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Inicio /> {/* Esta es la sección donde está el botón "Ver más" */}

      {/* Define los IDs para cada sección */}
      <section id="sobre-nosotros">
        <SobreNosotros />
      </section>

      <section id="productos">
        <Productos />
      </section>

      <section id="ubicacion">
        <Ubicacion />
      </section>

      <section id="realizar-pedido">
        <RealizarPedido />
      </section>

      {/* Si tienes un footer, iría aquí */}
    </div>
  );
}

export default App;
